INSERT INTO `update_opps` (`id`, `libelle`, `commentaire`, `personne`, `date`, `commercial_id`, `entreprise_client_id`, `superieur_id`, `opportunite_id`, `prospect_id`, `update_id`, `created_at`, `updated_at`) VALUES
(1, NULL, 'CILSS souhaite une nouvelle présentation DEMO en vidéo conférence le Mardi 15 Nov 2022 de 9h à 11h', NULL, '2022-11-14', 28, NULL, 36, 160, 159, NULL, '2022-11-14 07:47:03', '2022-11-14 08:47:03'),
(2, NULL, 'Top management non interessé. Mr Yaméogo n\'est plus DRH à CIM METAL mais à ALS. Une OS sera envoyée', NULL, '2022-11-14', 28, NULL, 36, 162, 164, NULL, '2022-11-14 09:51:34', '2022-11-14 10:51:34'),
(3, 'En négociation', 'Le prospect affirme être en train de gérer en interne des actions prioritaires. Il va nous revenir sous peu pour nous proposer des dates pour les formations demandées.\r\n\r\nDeux tentatives d\'appel et un mail lui ont été envoyé cette semaine (la période du 22 au 27 Novembre lui a été proposée). \r\nGeoffroy pourrait tenter de le rencontrer en Côte d\'Ivoire durant son séjour pour pousser l\'opportunité.', 'Kadio BOSSON - Country Learning Partner UBA CI', '2022-11-15', 80, NULL, 25, 148, 115, NULL, '2022-11-15 10:10:37', '2022-11-15 11:10:37'),
(4, 'Poursuivant la réalisation de la mission d\'immersion avant envoi d\'une convention de partenariat', 'En attente de la validation de la période (dates) d\'immersion par la Directrice du programme', 'Daouda Alkaly SAGNA', '2022-11-15', 80, NULL, 25, 146, 111, NULL, '2022-11-15 10:16:13', '2022-11-15 11:16:13'),
(5, 'Places offertes au webinaire ADF du 26 Novembre', '10 places leur ont été offerte. 06 personnes figurent sur la liste de participants qu\'ils nous ont fourni. \r\n\r\nIls nous ont dit qu\'ils sont vraiment intéressé par ILLIMITIS et l\'idée de travailler avec nous en 2023 car leur budget de formation pour cette année est déjà épuisé.\r\n\r\nDans le suivi de la relation client, j\'envisage de leur faire parvenir notre catalogue 2023 dès que possible pour renforcer cet intérêt', 'Demba NDIABE', '2022-11-15', 80, NULL, 25, 142, 109, NULL, '2022-11-15 10:52:08', '2022-11-15 11:52:08'),
(6, 'En attente de notre catalogue 2023 pour programmer une rencontre avec la Responsable en charge de la', 'Offre envoyée pour ByFeeding toujours à l\'étude au sein du département formation à qui la décision finale revient', 'Nathaniel SANTYOS', '2022-11-15', 80, NULL, 25, 145, 113, NULL, '2022-11-15 14:03:48', '2022-11-15 15:03:48'),
(11, 'Présentation COLLABORATIS', 'Présentation effectuée avec le bureau exécutif le 15 Nov. Fiche technique +vidéo transmise. Les recherches de financement sont en cours ainsi que la refonte et digitalisation des RH pour tous les états. A recontacter en Mars 2023.', NULL, '2022-11-18', 28, NULL, 36, 160, 159, NULL, '2022-11-18 09:31:52', '2022-11-18 10:31:52'),
(13, 'Démo collaboratis au bureau exécutif', 'Démo effectuée le 15 Nov au bureau executif. Fiche technique et vidéo transmise. Sont en recherche de financements. A recontacter en Fév 2023 pour le suivi', NULL, '2022-11-18', 28, NULL, 36, 160, 159, NULL, '2022-11-18 09:47:48', '2022-11-18 10:47:48'),
(14, 'présentation de hellovente à Maroc-food', '_ Présentation faite à Maroc-Food le jeudi 17novembre 2022', 'ANASTASIE', '2022-11-18', 80, NULL, 25, 191, 206, NULL, '2022-11-18 13:00:10', '2022-11-18 14:00:10'),
(15, 'Programmation pour 2023', 'Cette opportunité sera reconduite en 2023 courant 1er trimestre', NULL, '2023-02-02', 36, NULL, 36, 176, 182, NULL, '2022-12-07 18:19:54', '2022-12-07 19:19:54'),
